import React from 'react';
import ReactDOM from 'react-dom';

const navbar  ={
	display: 'flex',
	flexDirection:'row',
}
const navItem = {
	padding: '5px',
}



export default function Header(){
	return(
		<div style ={navbar}>
			<h3 style ={navItem}>Missing persons information </h3>

			<h3 style ={navItem}>Issues</h3>

			<h3 style ={navItem}>More information</h3>
		</div>



		)



}
